import styled from "styled-components";

export const Container =styled.div`
    min-height: 698px;
    position: fixed;
    bottom: 0;
    left: 0;
    top: 0;
    right: 0;
    z-index: 0;
    overflow: hidden;
    background: linear-gradient(
        110deg,
        rgba(33, 53, 70, 0.514),
        rgba(175, 216, 252, 0.514)
    );
`
